import React from 'react';
import StickyNote from '../StickyNote';

const PendingTasks = () => {

    const loadTasks = () => {
        for (let n = 0; n < 10; n++) {
            let data = JSON.parse(localStorage.getItem(n));
            console.log(data)

            return (
                <StickyNote color={data.color}>{data.task}</StickyNote>
            )
        }


    }


    return (
        <div>
            {
                loadTasks()
            }
        </div>
    );
}

export default PendingTasks;
